import React from "react";
import Navbar from "./Navbar";
import { makeStyles } from "@material-ui/core/styles";
import Carousel from "react-material-ui-carousel";
import funfinancial from "../Videos/funfinancial";
import {
  Box,
  Grid,
  Card,
  CardActionArea,
  CardActions,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@material-ui/core";

const useStyles = makeStyles({
  mainContainer: {
    background: "#3E3E3E",
    height: "100%",
  },
});

const Portfolio = () => {
  const classes = useStyles();

  const gifs = [
    {
      name: "Fun Financial",
      description:
        "An App to teach your kids how to manage credit from a young age. JavaScript | ReactJS/Hooks | Ruby | Ruby on Rails | PostgreSQL",
      image: funfinancial,
    },
  ];
  return (
    <>
      <Box component="div" className={classes.mainContainer}>
        <Navbar />
      </Box>
    </>
  );
};

export default Portfolio;
